        fetch("/users")
        .then((res)=> { return res.json();})
        .then((data)=> {
            console.log(data);
        })
    }

    useEffect(() => {
        fetchData();
    }, []);
    
    return (
        <>
            <h1>Home page</h1>
            <Users/>
        </>
    )
}

export default Home
